(242, 407, 1, 'About', '2022-05-16 14:40:01', '2022-05-16 14:40:01', '73ba94f2-c164-4625-b3ed-c4e6dbf16ab8', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ber uns', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"paragraph\">Um Ihnen und der <strong>Individualitt</strong>, die sie suchen, gerecht zu werden, steht das Zuhren und achtsame Beraten bei uns an erster Stelle.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(243, 411, 1, 'Ren Sigrist', '2022-05-16 14:40:38', '2022-08-24 01:30:32', '50a804c3-2219-4ff8-80d7-a9e0ed1cbd75', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ren Sigrist', 'Inhaber, Managing Partner', '+41 79 455 65 47', 'rene.sigrist@lautissimi.ch', 'Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master fr Dienstleistungsmarketing an der HSLU untersttzen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zustzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert fr Kunden und Gste zu behalten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(244, 412, 1, 'Ren Sigrist', '2022-05-16 14:41:33', '2022-05-16 14:41:33', '17224b7b-4aa8-4ba7-ae6a-3929065d785c', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ren Sigrist', 'Inhaber, Managing Partner', 'tel:+41-79-455-65-47', 'mailto:rene.sigrist@lautissimi.ch', 'Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master fr Dienstleistungsmarketing an der HSLU untersttzen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zustzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert fr Kunden und Gste zu behalten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(245, 413, 1, 'Beatrix Otahal', '2022-05-16 14:41:42', '2022-08-24 01:31:06', '1d7c6986-174c-45f6-8fc1-f1c05fa2ae56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Inhaberin, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'Very early childhood ambition of interior design has been the determining begin studying architecture and economic sciences.\n\nProfessional qualifications had been acquired by working focused on topics of architecture, 3D-CAD, carpentry and  FF&E in Europe and at least in Switzerland. These decades of experience are valuable skills in technical planning, custom-made production of decorative lighting and individual interiors additional to the range of standard products. \nThe foundation of LAUTISSIMI Vienna in 2014 was markable for the beginning of my self-employment and was proceeded in 2016 with subsequent professional establishment in Switzerland.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(246, 414, 1, 'Beatrix Otahal', '2022-05-16 14:42:41', '2022-05-16 14:42:41', 'cca8d0f9-1307-46b4-ba95-dbaeb78b5d6d', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Inhaberin, Managing Partner', 'http://+41+78+625+50+78', 'http://beatrix.otahal@lautissimi.ch', 'Rume zu kreieren, in denen sich Gste wohl fhlen ist meine Spezialitt. Die Arbeit mit physischen Produkten in Abstimmung mit Materialien, Formen und Farben liegt mir sehr. In der Zusammenarbeit mit Bauherren, Architekten, Innenarchitekten und Gestaltern erarbeite und finde ich immer die optimale Lsung. Meine Aus- und Weiterbildungen in Gestaltung und Planung und die tiefen Kenntnisse in der Materialkunde erleichtern mir dabei die tgliche Arbeit. Mit Begeisterung ergnze ich die Mbel und Textilien mit individuellen dekorativen Leuchten. Viele Jahre entwickelte und realisierte ich in Zusammenarbeit mit Interior Designern und Produzenten Leuchten aller Arten und Dimensionen. Die Wirkung solcher Objekte im Raum ist enorm und das Resultat fr Gste, Kunden und mich selbst immer wieder ein Erlebnis.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(248, 419, 1, 'About', '2022-05-16 15:17:19', '2022-05-16 15:17:19', '9ef9df54-a98a-468c-a709-3f0e92a93a9a', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ber uns', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"paragraph\">Um Ihnen und der <strong>Individualitt</strong>, die sie suchen, gerecht zu werden, steht das Zuhren und achtsame Beraten bei uns an erster Stelle.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
