(1308, 1948, 2, 'Hero', '2022-06-01 10:21:26', '2022-06-01 10:21:26', '52abe8a1-45a0-4ccb-a3aa-ec38d9fc0df8', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Unique rooms that inspire.', 'Furnishing rooms according to your wishes is our passion. Thereby our thinking and acting follows the demand for independence, harmony and functionality.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1311, 1950, 1, 'Beatrix Otahal', '2022-06-01 10:48:00', '2022-06-01 10:48:00', '0d0811bf-9262-4ddb-b3a4-6a14130119af', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Inhaberin, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'Rume zu kreieren, in denen sich Gste wohl fhlen ist meine Spezialitt. Die Arbeit mit physischen Produkten in Abstimmung mit Materialien, Formen und Farben liegt mir sehr. In der Zusammenarbeit mit Bauherren, Architekten, Innenarchitekten und Gestaltern erarbeite und finde ich immer die optimale Lsung. Meine Aus- und Weiterbildungen in Gestaltung und Planung und die tiefen Kenntnisse in der Materialkunde erleichtern mir dabei die tgliche Arbeit. Mit Begeisterung ergnze ich die Mbel und Textilien mit individuellen dekorativen Leuchten. Viele Jahre entwickelte und realisierte ich in Zusammenarbeit mit Interior Designern und Produzenten Leuchten aller Arten und Dimensionen. Die Wirkung solcher Objekte im Raum ist enorm und das Resultat fr Gste, Kunden und mich selbst immer wieder ein Erlebnis.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1312, 1950, 2, 'Beatrix Otahal', '2022-06-01 10:48:00', '2022-06-01 10:48:00', '45e7ec4e-16bf-4be4-84ff-918b96a8e490', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Inhaberin, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'Rume zu kreieren, in denen sich Gste wohl fhlen ist meine Spezialitt. Die Arbeit mit physischen Produkten in Abstimmung mit Materialien, Formen und Farben liegt mir sehr. In der Zusammenarbeit mit Bauherren, Architekten, Innenarchitekten und Gestaltern erarbeite und finde ich immer die optimale Lsung. Meine Aus- und Weiterbildungen in Gestaltung und Planung und die tiefen Kenntnisse in der Materialkunde erleichtern mir dabei die tgliche Arbeit. Mit Begeisterung ergnze ich die Mbel und Textilien mit individuellen dekorativen Leuchten. Viele Jahre entwickelte und realisierte ich in Zusammenarbeit mit Interior Designern und Produzenten Leuchten aller Arten und Dimensionen. Die Wirkung solcher Objekte im Raum ist enorm und das Resultat fr Gste, Kunden und mich selbst immer wieder ein Erlebnis.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1315, 1952, 1, 'Ren Sigrist', '2022-06-01 10:48:24', '2022-06-01 10:48:24', '98733816-d7a8-4414-827e-185e5de32c60', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ren Sigrist', 'Inhaber, Managing Partner', '+41 79 455 65 47', 'rene.sigrist@lautissimi.ch', 'Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master fr Dienstleistungsmarketing an der HSLU untersttzen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zustzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert fr Kunden und Gste zu behalten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
