(1319, 1958, 2, 'Services', '2022-06-01 11:07:16', '2022-06-01 11:07:16', '07527c3f-070f-417c-8d16-951ffcacf5ce', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Services', '<p class=\"paragraph\">LAUTISSIMI offers holistic,<strong> individual furnishing solutions</strong> for the gastronomy, hotel, office, healthcare as well as public areas.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
