(1335, 1976, 1, 'Beatrix Otahal', '2022-06-02 21:35:31', '2022-06-02 21:35:31', '4bc64628-f6f7-484d-985c-652f7eedf7a3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Inhaberin, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'Bereits in sehr jungen Tagen war klar, Innenarchitektur ist\nmeine Zukunft. Die solide Ausbildung erlaubte den\nEinstieg zum Studium der Architektur und der\nHandelswissenschaften in sterreich.\n\nMeine beruflichen Erfahrungen in den Bereichen\nBauwesen, 3D-CAD, Schreinerarbeiten und FF&E sammelte\nich im Raum Europa und zuletzt schweizweit. Diese ber\nJahre erarbeitete Kompetenz fr individuelle\nMblierungen und\nmassgeschneiderte, dekorative\nBeleuchtungen bilden eine wertvolle Ergnzung zu\nHerstellerprodukten.\nDie Grndung LAUTISSIMI Wien 2014 war mein Start zur\nSelbstndigkeit mit anschliessender beruflicher\nEtablierung in der Schweiz', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1336, 1976, 2, 'Beatrix Otahal', '2022-06-02 21:35:31', '2022-06-02 21:35:31', '7762dfd8-a8da-4837-99d9-6c3ec0ef8e01', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Owner, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1339, 1978, 2, 'Ren Sigrist', '2022-06-02 21:36:47', '2022-06-02 21:36:47', '56eddbcb-1924-47f3-83ae-ddcc2a2d3f11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ren Sigrist', 'Owner, Managing Partner', '+41 79 455 65 47', 'rene.sigrist@lautissimi.ch', 'I am fascinated by the uniqueness that lies in each of our projects. The ever-changing initial situations require flexible thinking and a great deal of empathy. In order to find the right product solution for our customers, I am helped not only by my many years of experience but also by the trusting cooperation with the manufacturers. My basic training as a craftsman as well as further training in marketing with a master\'s degree in services marketing at the HSLU support me in practical tasks on a day-to-day basis. A wide range of interests and the ability to tackle topics outside of my usual environment also distinguish me. Because my goal is to always keep an eye on the added value for customers and guests.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
