(221, 964, 2, '2022-05-24 13:17:52', '2022-05-31 11:22:03', 'cc270fa9-de10-4b5b-b16b-16e909032dee', 'Copyright', 'The contents contained on this website are protected by copyright for LAUTISSIMI. In particular, reproductions, translations, adaptations and the storage and processing in other media, including those in electronic form, are protected by copyright. LAUTISSIMI as operator of the website permits the viewing and downloading of all content on its websites exclusively for private, non-commercial use. The contents may not be changed and used on other websites or networked computers without written permission from LAUTISSIMI. The reproduction of data or information, in particular the use of texts, parts of texts or images, requires prior written consent. For press inquiries and the editorial use of image material, please contact LAUTISSIMI (see imprint).'),
(222, 965, 2, '2022-05-24 13:17:52', '2022-05-31 11:22:03', '00179aa0-680e-4bd0-a9ac-a048698543f4', 'Warranty and liability', 'LAUTISSIMI makes every effort to ensure that the information on the website is always up to date. Despite all care, the data may have changed in the meantime. Therefore, no liability or guarantee can be assumed for the topicality, correctness and completeness of the information provided.\nFurthermore, LAUTISSIMI reserves the right to make changes or additions to the information provided.'),
(223, 966, 2, '2022-05-24 13:17:52', '2022-05-31 11:22:03', '831fb3af-03c6-4746-97a7-7090087f32f2', 'References and links', 'The same applies to all other websites to which reference is made by means of hyperlinks. LAUTISSIMI is not responsible for the content of websites that are reached via such a link.'),
(224, 967, 2, '2022-05-24 13:17:52', '2022-05-31 11:22:03', '40dafc76-1f88-4849-b05f-f93b1af4adf3', 'Storage of access data in server log files', 'You can visit our website without providing any personal information. We only store access data in so-called server log files, such as the name of the requested file, date and time of the request, amount of data transferred and the requesting provider. These data are evaluated exclusively to ensure trouble-free operation of the site and to improve our offer and do not allow us to draw any conclusions about your person.\nWe collect personal data if you voluntarily provide it to us when contacting us (e.g. via contact form or e-mail). Which data is collected can be seen from the respective input forms; in doing so, we adhere to the principles of data avoidance and data economy. We use the data you provide to process the contract and to handle your inquiries. After complete processing of the contract or deletion of your customer account, your data will be blocked for further use and deleted, unless you have expressly consented to further use of your data or we reserve the right to use data beyond this, which is permitted by law.'),
(225, 968, 2, '2022-05-24 13:17:52', '2022-05-31 11:22:03', 'c60b922d-b6cc-4ed4-8dc3-9b74728ff88a', 'Disclosure of personal data', 'Your data will not be passed on to third parties without your express consent. The only exceptions to this are our service partners, which we need to process the contractual relationship, as well as if there is a legal obligation to disclose or the disclosure is necessary for any criminal prosecution and is permitted by law. In these cases, we strictly observe the requirements of the Swiss Data Protection Act (DSG) and the EU General Data Protection Regulation (EU-DSGVO). The scope of the data transfer is limited to a minimum.'),
(226, 969, 2, '2022-05-24 13:17:52', '2022-05-31 11:22:03', 'b44a1f2a-04e6-4a9e-9f25-8a105f702bba', 'Usage of cookies', 'In order to make visiting our website more attractive and to enable the use of certain functions, we use so-called cookies on various pages. These are small text files that are stored on your terminal device. Some of the cookies we use are deleted at the end of the browser session, i.e. after you close your browser (so-called session cookies). Other cookies remain on your end device and allow us to recognize your browser on your next visit (persistent cookies). You can set your browser so that you are informed about the setting of cookies and decide individually about their acceptance or exclude the acceptance of cookies for certain cases or in general. If you do not accept cookies, the functionality of our website may be limited.'),
