(320, 1397, 1, '2022-05-25 11:31:59', '2022-05-25 11:31:59', '6baaedf1-e11e-4861-9c56-56913838c0f4', 'Verwendung von Cookies', 'Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgert gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgert und ermglichen uns, Ihren Browser beim nchsten Besuch wiederzuerkennen (persistente Cookies). Sie knnen Ihren Browser so einstellen, dass Sie ber das Setzen von Cookies informiert werden und einzeln ber deren Annahme entscheiden oder die Annahme von Cookies fr bestimmte Flle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalitt unserer Website eingeschrnkt sein.'),
(321, 1397, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'ba19c880-f535-4da9-adce-4206cc271a3d', 'Verwendung von Cookies', 'Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgert gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgert und ermglichen uns, Ihren Browser beim nchsten Besuch wiederzuerkennen (persistente Cookies). Sie knnen Ihren Browser so einstellen, dass Sie ber das Setzen von Cookies informiert werden und einzeln ber deren Annahme entscheiden oder die Annahme von Cookies fr bestimmte Flle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalitt unserer Website eingeschrnkt sein.'),
(322, 1398, 1, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'a0e648ad-0f70-47e3-aad3-9503601ba3b6', 'Kontaktformular', 'Wenn Sie mit uns ber das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlsselt bertragen, um eine angemessene Sicherheit dieser Daten zu gewhrleisten.'),
(323, 1398, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', '8f1e4db9-4c9f-43e6-af79-9184283db569', 'Kontaktformular', 'Wenn Sie mit uns ber das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlsselt bertragen, um eine angemessene Sicherheit dieser Daten zu gewhrleisten.'),
(340, 1815, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '3697e8aa-de64-4898-9768-0a342fa3b453', 'Introduction', 'We attach great importance to the protection of your data and the protection of your privacy. Below we therefore inform you about the collection and use of personal data when using our website.\nLAUTISSIMI is guided in its handling of data by the Swiss Data Protection Act (DSG) and the EU General Data Protection Regulation (EU-DSGVO).'),
(341, 1815, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'e01b972b-806c-4395-a02d-0f5954a200d5', 'Einleitung', 'Wir legen grssten Wert auf den Schutz Ihrer Daten und die Wahrung Ihrer Privatsphre. Nachstehend informieren wir Sie deshalb ber die Erhebung und Verwendung persnlicher Daten bei Nutzung unserer Webseite.\nLAUTISSIMI orientiert sich im Umgang mit Daten am Datenschutzgesetz der Schweiz (DSG) sowie an der EU-Datenschutzgrundverordnung (EU-DSGVO).'),
(342, 1816, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '57a964b3-4425-4150-ada9-b5cce4704fbe', 'Copyright', 'The contents contained on this website are protected by copyright for LAUTISSIMI. In particular, reproductions, translations, adaptations and the storage and processing in other media, including those in electronic form, are protected by copyright. LAUTISSIMI as operator of the website permits the viewing and downloading of all content on its websites exclusively for private, non-commercial use. The contents may not be changed and used on other websites or networked computers without written permission from LAUTISSIMI. The reproduction of data or information, in particular the use of texts, parts of texts or images, requires prior written consent. For press inquiries and the editorial use of image material, please contact LAUTISSIMI (see imprint).'),
(343, 1816, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'a048e52d-b842-41a4-b08d-73ec21f24cc5', 'Urheberrecht', 'Die auf dieser Website enthaltenen Inhalte sind fr LAUTISSIMI urheberrechtlich geschtzt. Insbesondere Vervielfltigungen, bersetzungen, Bearbeitungen und die Speicherung und Verarbeitung in andere Medien, einschliesslich solcher in elektronischer Form, sind urheberrechtlich geschtzt. LAUTISSIMI als Betreiberin der Website gestattet das Sichten und Herunterladen smtlicher Inhalte auf ihren Websites ausschliesslich zu privatem, nicht-kommerziellem Gebrauch. Die Inhalte drfen nicht verndert und ohne schriftliche Genehmigung von LAUTISSIMI auf anderen Internetseiten oder vernetzten Rechnern genutzt werden. Die Vervielfltigung von Daten oder Informationen, insbesondere die Verwendung von Texten, Textteilen oder Bildmaterial, bedarf der vorherigen schriftlichen Zustimmung. Fr Presseanfragen und die redaktionelle Verwendung von Bildmaterial wenden Sie sich bitte an LAUTISSIMI (siehe Impressum).'),
(344, 1817, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '4b291c37-6109-4400-b26c-c675a242ee7e', 'Warranty and liability', 'LAUTISSIMI makes every effort to ensure that the information on the website is always up to date. Despite all care, the data may have changed in the meantime. Therefore, no liability or guarantee can be assumed for the topicality, correctness and completeness of the information provided.\nFurthermore, LAUTISSIMI reserves the right to make changes or additions to the information provided.'),
(345, 1817, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'acabe8b0-6bdd-4f83-a48f-3425de72cfec', 'Gewhrleistung und Haftung', 'LAUTISSIMI ist darum bemht, dass die Informationen auf der Website stets auf dem aktuellen Stand sind. Trotz aller Sorgfalt knnen sich die Daten inzwischen verndert haben. Eine Haftung oder Garantie fr die Aktualitt, Richtigkeit und Vollstndigkeit der zur Verfgung gestellten Informationen kann daher nicht bernommen werden.\nDes Weiteren behlt sich die LAUTISSIMI das Recht vor, nderungen oder Ergnzungen der bereitgestellten Informationen vorzunehmen.'),
(346, 1818, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'bab8fabc-18fc-4c77-b840-2c18dc07c8e1', 'References and links', 'The same applies to all other websites to which reference is made by means of hyperlinks. LAUTISSIMI is not responsible for the content of websites that are reached via such a link.'),
(347, 1818, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '9f51357f-51b5-41ca-b77e-77d18a030503', 'Verweise und Links', 'Gleiches gilt auch fr alle anderen Websites, auf die mittels Hyperlink verwiesen wird. LAUTISSIMI ist fr den Inhalt der Websites, die aufgrund einer solchen Verbindung erreicht werden, nicht verantwortlich.'),
(348, 1819, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '6bc6d813-3c4e-4c53-9df2-d69fbec5038c', 'Storage of access data in server log files', 'You can visit our website without providing any personal information. We only store access data in so-called server log files, such as the name of the requested file, date and time of the request, amount of data transferred and the requesting provider. These data are evaluated exclusively to ensure trouble-free operation of the site and to improve our offer and do not allow us to draw any conclusions about your person.\nWe collect personal data if you voluntarily provide it to us when contacting us (e.g. via contact form or e-mail). Which data is collected can be seen from the respective input forms; in doing so, we adhere to the principles of data avoidance and data economy. We use the data you provide to process the contract and to handle your inquiries. After complete processing of the contract or deletion of your customer account, your data will be blocked for further use and deleted, unless you have expressly consented to further use of your data or we reserve the right to use data beyond this, which is permitted by law.'),
