(352, 1821, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'b95d4abc-d551-44f4-a29d-c98e655ccadf', 'Usage of cookies', 'In order to make visiting our website more attractive and to enable the use of certain functions, we use so-called cookies on various pages. These are small text files that are stored on your terminal device. Some of the cookies we use are deleted at the end of the browser session, i.e. after you close your browser (so-called session cookies). Other cookies remain on your end device and allow us to recognize your browser on your next visit (persistent cookies). You can set your browser so that you are informed about the setting of cookies and decide individually about their acceptance or exclude the acceptance of cookies for certain cases or in general. If you do not accept cookies, the functionality of our website may be limited.'),
(353, 1821, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '4488afdb-6fa1-4fa3-8d05-7e914cf1e963', 'Verwendung von Cookies', 'Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgert gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgert und ermglichen uns, Ihren Browser beim nchsten Besuch wiederzuerkennen (persistente Cookies). Sie knnen Ihren Browser so einstellen, dass Sie ber das Setzen von Cookies informiert werden und einzeln ber deren Annahme entscheiden oder die Annahme von Cookies fr bestimmte Flle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalitt unserer Website eingeschrnkt sein.'),
